import React from "react";
import { useNavigate, Navigate } from "react-router-dom";

const ProtectedRoute = ({ children, user }) => {
  const navigate = useNavigate();
  if (!user) return <Navigate to="/" />;
  return children;
};

export default ProtectedRoute;
